svg.script:
const svg = document.getElementById("svg2")
const gyre = {
  width: getQueryVariable("gyre"),
  score: 0,	target: 6, switch: 1, complete: false,
  start: function(_titleScreen, _refreshRate, _gyration, _timeOut) {
	rotate(svg.getElementById("frame"), Math.floor(Math.random() * 360), 200, 200)
	_titleScreen.style.display="none"
	setInterval(function(){
		_gyration(svg.getElementById(grps[Math.floor(Math.random() * grps.length)]))
	}, _refreshRate);
	setInterval(function(){
		if (!gyre.complete) {
			window.location.reload()
		}
	}, _timeOut);	
  }
};

var grps = ['layer1-2', 'g3006', 'g3025', 'g3046', 'g3069', 'g3094', 'g3121', 'g3145', 'g3166', 'g3189', 'g3214', 'g3241', 'g3270', 'g3297', 'g3322', 'g3349', 'g3378', 'g3409', 'g3439', 'g3468', 'g3500', 'g3533', 'g3566', 'g3599', 'g3633', 'g3669', 'g3706', 'g3745'] 
var dom0 = ['layer1-2', 'g3006', 'g3094', 'g3046', 'g3069', 'g3025', 'g3121'], dom1 = ['g3145', 'g3006', 'g3166', 'g3189', 'g3214', 'g3241', 'g3270'], dom2 = ['g3025', 'g3166', 'g3297', 'g3322', 'g3349', 'g3378', 'g3409'], dom3 = ['g3046', 'g3189', 'g3322', 'g3439', 'g3468', 'g3599', 'g3566'], dom4 = ['g3069', 'g3214', 'g3349', 'g3468', 'g3533', 'g3500', 'g3633'],  dom5 = ['g3094', 'g3241', 'g3378', 'g3599', 'g3500', 'g3669', 'g3706'], dom6 = ['g3121', 'g3270', 'g3409', 'g3566', 'g3633', 'g3706', 'g3745']

svg.addEventListener("load",function(){
	svg.getElementById("blank").style.display="none"
	if (svg.getElementById("title" + gyre.width))
		 svg.getElementById("title" + gyre.width).style.display="inline"
	else
		 svg.getElementById("fin").style.display="inline"
}, false);

function maples( _el ) {
	var die = Math.floor(Math.random() * 10)
	switch (die) {
		case 0: case 1: case 2: 
			translate(_el, Math.floor(Math.random() * 80)-40, Math.floor(Math.random() * 80)-40)
			break
		case 3:	case 4:	case 5: case 6:	case 7:			
			rotate(_el, (die+10)*gyre.switch, 0 ,0)
			break
		 case 8: case 9:			
			scale(_el, (die)/10, (die)/10)
			break
	}
}

function falcons( _el ) {
	var die = Math.floor(Math.random() * 4)
	switch (die) {
		case 0: 
		case 1: 
			scale(_el, 0.9, 0.9)
		case 2:
			rotate(_el, -8*gyre.switch, 30, -500)
	}
}	


function eliminate(id, ...rest) {
	grps = grps.filter(i => i !== id); scale(svg.getElementById(id), 0.01)

	// restart at next gyre if we have reached the target for the current gyre
	if (++gyre.score == gyre.target) {
		gyre.complete = true
		svg.getElementById("complete").style.display = "inline"
		setTimeout(() => {
			href = window.location.href + ("&gyre=" + ++gyre.width);window.location.href=href
		}, "1500");
	}

	// increase frequency of adjacent dominoes 
	for (const doms of rest) {
		var col = getRandomColor()
		for (dom in doms) {
			el=svg.getElementById(doms[dom])
			grps.push(doms[dom])
			hilite(el, col); scale(el, 0.7, 0.7)
		}
	}
}

function hilite(_el, _col) {
	var style = _el.getElementsByTagName("rect")[0].style
	style.fill = _col; style.opacity = 0.8
}

function getRandomColor() {
	var letters = '0123456789ABCDEF', color = '#'
	for (var i = 0; i < 6; i++) {
		color += letters[Math.floor(Math.random() * 16)]
	}
	return color;
}

function scale( _el, _x, _y) {
	var transform = _el.transform.baseVal.getItem(0), mat = transform.matrix  
	transform.setMatrix( mat.scale( _x, _y ) )
}

function rotate( _el, _r, _x, _y) {
	var transform = _el.transform.baseVal.getItem(0), mat = transform.matrix   
	transform.setMatrix( mat.translate( _x, _y ) )
	transform.setMatrix( mat.rotate( _r) )
	transform.setMatrix( mat.translate( -_x, -_y ) )
}

function translate( _el, _x, _y) {
	var transform = _el.transform.baseVal.getItem(0), mat = transform.matrix   
	transform.setMatrix( mat.translate( _x, _y ) )
}

function getQueryVariable(variable) {
	var query = window.location.search.substring(1);
	var vars = query.split('&');
	for (var i = vars.length-1; i >= 0; --i) {
		var pair = vars[i].split('=');
		if (decodeURIComponent(pair[0]) == variable) {
			return decodeURIComponent(pair[1]);
		}
	}
	href = window.location.href + ("?gyre=0"); window.location.href=href
}
